[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT ?xref ?xrefType
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  <http://rdf.ebi.ac.uk/resource/chembl/molecule/CHEMBL1380> cco:moleculeXref ?xref .
  BIND(
    IF(STRSTARTS(STR(?xref), "http://www.drugbank.ca/"), "DrugBank",
    IF(STRSTARTS(STR(?xref), "http://pubchem.ncbi.nlm.nih.gov/"), "PubChem",
    IF(STRSTARTS(STR(?xref), "http://purl.obolibrary.org/obo/CHEBI_"), "ChEBI",
    IF(STRSTARTS(STR(?xref), "http://identifiers.org/zinc/"), "ZINC",
    IF(STRSTARTS(STR(?xref), "http://linkedchemistry.info/chembl/chemblid/"), "LinkedChemistry",
    "Other"))))) AS ?xrefType
  )
}
ORDER BY ?xrefType"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT ?label ?chemblId ?substanceType ?developmentPhase ?atc ?exactMatch
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  <http://rdf.ebi.ac.uk/resource/chembl/molecule/CHEMBL1380> 
    rdfs:label ?label ;
    cco:chemblId ?chemblId ;
    cco:substanceType ?substanceType .
  OPTIONAL { <http://rdf.ebi.ac.uk/resource/chembl/molecule/CHEMBL1380> cco:highestDevelopmentPhase ?developmentPhase }
  OPTIONAL { <http://rdf.ebi.ac.uk/resource/chembl/molecule/CHEMBL1380> cco:atcClassification ?atc }
  OPTIONAL { <http://rdf.ebi.ac.uk/resource/chembl/molecule/CHEMBL1380> skos:exactMatch ?exactMatch }
}"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT (COUNT(DISTINCT ?protein) as ?count)
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:reviewed true ;
           up:classifiedWith ?keyword .
  ?keyword rdfs:label ?label .
  FILTER(CONTAINS(LCASE(?label), "kinase"))
}
"}}]

[{"name": "mcp__togomcp__get_sparql_endpoints", "input": {}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT ?significance (COUNT(?variant) as ?count)
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           cvo:record_status "current" ;
           cvo:classified_record ?classrec .
  ?classrec cvo:classifications/cvo:germline_classification/cvo:description ?significance .
}
GROUP BY ?significance
ORDER BY DESC(?count)"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT (COUNT(DISTINCT ?variant) as ?total_variants)
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           cvo:record_status "current" ;
           cvo:classified_record ?classrec .
  ?classrec cvo:classifications/cvo:germline_classification/cvo:description ?significance .
}"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "go"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "reactome"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "go", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX oboinowl: <http://www.geneontology.org/formats/oboInOwl#>
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?go ?goLabel ?reactomeXref
FROM <http://rdfportal.org/ontology/go>
WHERE {
  ?go a <http://www.w3.org/2002/07/owl#Class> ;
      rdfs:label ?goLabel ;
      oboinowl:hasOBONamespace "biological_process"^^xsd:string ;
      oboinowl:hasDbXref ?reactomeXref .
  FILTER(STRSTARTS(STR(?go), "http://purl.obolibrary.org/obo/GO_"))
  FILTER(REGEX(?reactomeXref, "^Reactome:", "i"))
}
ORDER BY ?go
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "go", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX oboinowl: <http://www.geneontology.org/formats/oboInOwl#>
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT (COUNT(DISTINCT ?go) as ?count)
FROM <http://rdfportal.org/ontology/go>
WHERE {
  ?go a <http://www.w3.org/2002/07/owl#Class> ;
      oboinowl:hasOBONamespace "biological_process"^^xsd:string ;
      oboinowl:hasDbXref ?reactomeXref .
  FILTER(STRSTARTS(STR(?go), "http://purl.obolibrary.org/obo/GO_"))
  FILTER(REGEX(?reactomeXref, "^Reactome:", "i"))
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "go", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX oboinowl: <http://www.geneontology.org/formats/oboInOwl#>
PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?goId ?goLabel ?definition (GROUP_CONCAT(DISTINCT ?reactomeXref; separator="; ") as ?reactomeRefs)
FROM <http://rdfportal.org/ontology/go>
WHERE {
  ?go a <http://www.w3.org/2002/07/owl#Class> ;
      oboinowl:id ?goId ;
      rdfs:label ?goLabel ;
      oboinowl:hasOBONamespace "biological_process"^^xsd:string ;
      oboinowl:hasDbXref ?reactomeXref .
  OPTIONAL { ?go obo:IAO_0000115 ?definition }
  FILTER(STRSTARTS(STR(?go), "http://purl.obolibrary.org/obo/GO_"))
  FILTER(REGEX(?reactomeXref, "^Reactome:", "i"))
  FILTER(CONTAINS(?goLabel, "signaling") || CONTAINS(?goLabel, "immune") || CONTAINS(?goLabel, "cell cycle") || CONTAINS(?goLabel, "metabolism") || CONTAINS(?goLabel, "DNA"))
}
GROUP BY ?goId ?goLabel ?definition
ORDER BY ?goLabel
LIMIT 30"}}]

[{"name": "mcp__pubdictionaries__search", "input": {"labels": "Type 2 diabetes, diabetes mellitus type 2", "dictionary": "MONDO"}}, {"name": "mcp__ols__search", "input": {"query": "Type 2 diabetes mellitus"}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "diabetes mellitus type 2", "limit": 30}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "diabetes type 2", "limit": 30}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?molName ?maxPhase ?indication
WHERE {
  ?molecule a cco:Molecule ;
            cco:highestDevelopmentPhase ?maxPhase .
  OPTIONAL { ?molecule rdfs:label ?molName }

  ?activity cco:hasMolecule ?molecule ;
            cco:hasAssay ?assay .

  ?assay cco:hasTarget ?target ;
         cco:hasDocument ?doc .

  ?indication cco:hasDocument ?doc .
  ?indication rdfs:label ?indicationLabel .

  FILTER(REGEX(?indicationLabel, "diabetes", "i") || REGEX(?indicationLabel, "diabetic", "i"))
  FILTER(?maxPhase >= 1)
}
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?molName ?maxPhase
WHERE {
  ?mol a cco:Molecule ;
       rdfs:label ?molName ;
       cco:highestDevelopmentPhase ?maxPhase .

  ?drugInd cco:hasMolecule ?mol ;
           cco:hasDiseaseEfoId ?disease .

  ?disease rdfs:label ?diseaseLabel .

  FILTER(REGEX(?diseaseLabel, "type 2 diabetes", "i") || REGEX(?diseaseLabel, "type II diabetes", "i"))
  FILTER(?maxPhase >= 1)
}
ORDER BY DESC(?maxPhase)
LIMIT 100"}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "type 2 diabetes drug development clinical trial phase", "max_results": 20, "sort": "pub_date"}}, {"name": "mcp__pubmed__get_article_metadata", "input": {"pmids": ["41267147", "41391569", "41352124", "41289823", "41207620"]}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "type 2 diabetes medications FDA approved 2024 2025", "max_results": 10, "sort": "pub_date"}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "metformin sitagliptin empagliflozin semaglutide insulin", "limit": 20}}]
